pub fn get_definition(code: OpCode) -> &'static Definition {
    let extended = code & 0xcb00 != 0;
    if !extended {
        &INSTRUCTIONS[code as usize]
    } else {
        &INSTRUCTIONS[((code & 0xff) + 256) as usize]
    }
}
